import React from "react";
import Posts from "./Posts";

const PostList = ({ postData }) => {
  return (
    <div>
      {postData.map((user, i) => {
        return (
          <Posts
            key={i}
            id={postData[i].id}
            name={postData[i].name}
            email={postData[i].email}
            post={postData[i].post}
          />
        );
      })}
    </div>
  );
};

export default PostList;
